import React from "react";
import SavingsResult from "./SavingsResult";
import MatchResult from "./MatchResult";

const yourRate = this.props.yourRate;
const customerRate = this.props.customerRate;

const Result = (yourRate, customerRate) => {
    if (customerRate === undefined) {
        return false
    }
    else if (yourRate - customerRate > 0) {
        return <SavingsResult 
            yourRate={this.yourRate}
            customerRate={this.customerRate}
        />
    }
    else {
        return <MatchResult />
    }
}

export default Result;
